import React from 'react';
import './ExampleList.css';

export default () => {
    return (
        React.createElement(
            'div',
            {className: 'containerTabs'},
            React.createElement(
                'div',
                {className: 'ul-list'},
                React.createElement(
                    'ul',
                    null,
                    React.createElement(
                        'li',
                        null,
                        'HTML'
                    ),
                    React.createElement(
                        'li',
                        null,
                        'JavaScript'
                    ),
                    React.createElement(
                        'li',
                        null,
                        'React',
                    ),
                )
            )
        )
    )
}
